import React from 'react';
import ReactDOM from 'react-dom';
import './index.css';
import App from './App';
import HelloMessage from './my-components/test'
import Timer from './my-components/dnd/timer'
import LeftScroll from "./my-components/dnd/left-scroll/left-scroll";
import Page from "./my-components/dnd/page/page";
import * as serviceWorker from './serviceWorker';

ReactDOM.render(
  <React.StrictMode>
    <App />
      <Page color="white"/>
      <Page color="#121212"/>
      <HelloMessage name="Misha"/>
      <Timer/>
      <LeftScroll/>

  </React.StrictMode>,
  document.getElementById('root')
);

// ReactDOM.render(
//     <HelloMessage name="Misha"/>,
//     document.getElementById('root')
// );

// If you want your app to work offline and load faster, you can change
// unregister() to register() below. Note this comes with some pitfalls.
// Learn more about service workers: https://bit.ly/CRA-PWA
serviceWorker.register();
